script: |
  super -f text -I q9515.spq | sort > q9515.out

inputs:
  - name: q9515.spq
    data: |
      SELECT - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + CAST ( NULL AS INTEGER ) BETWEEN + - ( - col1 ) AND - col1 * - ( - - 98 );
  - name: tab1

outputs:
  - name: q9515.out
    data: |
